import React from 'react'

const SmallContactContainer = ({}) => (
    <div>
        <style jsx>{`  
            input, select, textarea{
                background: #eee;
                border-radius: 0px;
                border: 0px;
                padding:10px;
            }
        `}</style>
        <div className="form-group">
            <label htmlFor="exampleFormControlInput1">Email address</label>
            <input type="email" className="form-control" id="exampleFormControlInput1" placeholder="name@example.com" />
        </div> 
        <div className="form-group">
            {/*<label htmlFor="exampleFormControlTextarea1">Example textarea</label>*/}
            <textarea className="form-control" id="exampleFormControlTextarea1" rows="3">Omschijving</textarea>
        </div>
        <button type="submit" className="btn btn-blue btn-lg btn-block">Versturen</button>

    </div>
)

export default SmallContactContainer
